const { default: styled } = require('styled-components');

export const StyleButton = styled.button`
  width: 400px;
  padding: 14px 15px;
  border-radius: 6px;
  background-color: var(--color-blue);
  border: 1px solid var(--border);
  color: var(--color-white);
  line-height: 1.3;
  margin-top: 30px;
`;
